import React, { useState } from 'react';
import { TextField, Typography, Grid } from '@mui/material';
import styles from './Dashboard.module.scss'; // Asigură-te că calea fișierului este corectă

function Dashboard() {
    const [firstName, setFirstName] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        // Logica pentru submit-ul formularului poate fi adăugată aici
    };

    return (
        <div className={styles.dashboardContainer}>
            <div className={styles.titleWrapper}>
                <div className={styles.title}>CREATE</div>
                <span className={styles.description}>
                    Embedding advanced urban material stock methods within governance
                    processes to enable circular economy and cities resilience
                </span>
            </div>

            <div className={styles.container}>
                <form onSubmit={handleSubmit}>
                    <Grid container spacing={2} alignItems="center">
                        <Grid item xs={12}>
                            <Typography variant="body1" className={styles.label}>
                                First Name
                            </Typography>
                            <TextField
                                variant="outlined"
                                margin="normal"
                                required
                                fullWidth
                                id="firstName"
                                name="firstName"
                                autoFocus
                                value={firstName}
                                onChange={(e) => setFirstName(e.target.value)}
                            />
                        </Grid>
                       
                    </Grid>
                </form>
            </div>
        </div>
    );
}

export default Dashboard;
